INSERT INTO `essay` (`essay_id`, `essay_title`, `essay_content`, `username`, `date_created`, `essay_status`) VALUES
(1, 'What Does a Computer Programmer Do?', 'A computer programmer creates the code for software applications and operating systems. After a software developer designs a computer program, the programmer writes code that converts that design into a set of instructions a computer can follow. He or she tests the program to look for errors and then rewrites it until it is  or error-free. The programmer continues to evaluate programs that are in use, making updates and adjustments as needed.', 'teacher', '06/12/2017 00:35', 'ACTIVE'),
(2, 'Life', 'Life is beautiful but not always easy, it has problems, too, and the challenge lies in facing them with courage, letting the beauty of life act like a balm, which makes the pain bearable, during trying times, by providing hope\r\n\r\n\r\nHappiness, sorrow, victory, defeat, day-night are the two sides of the me coin. Similarly life is full of moments of joy, pleasure, success and comfort punctuated by misery, defeat, failures and problems. There is no human being on Earth, strong, powerful, wise or rich, who has not experienced, struggle, suffering or failure.', 'teacher', '06/12/2017 00:36', 'ACTIVE'),
(3, 'Ethical Hacking', 'Ethical hacking and ethical hacker are terms used to describe hacking performed by a company or individual to help identify potential threats on a computer or network. An ethical hacker attempts to bypass system security and search for any weak points that could be exploited by malicious hackers. This information is then used by the organization to improve the system security, in an effort to minimize or eliminate any potential attacks.', 'teacher2', '06/18/2017 15:16', 'ACTIVE'),
(4, 'Internet', 'The Internet is the global system of interconnected computer networks that use the Internet protocol suite to link devices worldwide.', 'teacher2', '06/19/2017 22:50', 'ACTIVE'),
(5, 'Ethical Hacking', 'Ethical hacking and ethical hacker are terms used to describe hacking performed by a company or individual to help identify potential threats on a computer or network. An ethical hacker attempts to bypass system security and search for any weak points that could be exploited by malicious hackers. This information is then used by the organization to improve the system security, in an effort to minimize or eliminate any potential attacks.', 'teacher', '06/19/2017 22:56', 'ACTIVE'),
(6, 'Why people work? â€“ Essay', 'We often see a lot of people complaining about work. A majority of them regard working as an extremely hard, vapid and low earning affliction. They always dream to live a happy life without working. But in reality, itâ€™s is not possible to live without doing work. Each individual needs to work for various reasons, no matter whether he is the son of the billionaire or a layman struggling with poverty. To the best of my knowledge, the most common reasons for people to work are to acquire enormous knowledge, money and to enjoy life.', 'teacher', '07/05/2017 19:04', 'ACTIVE');

