(1, 1, 'user', 'A programmer, computer programmer, developer, dev, coder, or software engineer is a person who creates computer software.', 75, '6-16-2017 11:07 PM'),
(4, 1, 'student', 'A programmer, computer programmer, developer, dev, coder, or software engineer is a person who creates computer software. The term computer programmer can refer to a specialist in one area of computer programming or to a generalist who writes code for many kinds of software.', 44, '06/18/2017 13:12'),
(5, 2, 'student', 'Astronauts (Jake Gyllenhaal, Rebecca Ferguson, Ryan Reynolds) aboard the International Space Station are on the cutting edge of one of the most important discoveries in human history: the first evidence of extraterrestrial life on Mars. As members of the crew conduct their research, the rapidly evolving life-form proves far more intelligent and terrifying than anyone could have imagined.', 58, '06/18/2017 13:18'),
(6, 2, 'user', 'the condition that distinguishes animals and plants from inorganic matter, including the capacity for growth, reproduction, functional activity, and continual change preceding death.', 36, '06/18/2017 13:25'),
(7, 4, 'student', 'this is the proper way of hacking', 0, '06/19/2017 22:57'),
(17, 5, 'user', 'Hacking has been a part of computing for almost five decades and it is a very broad discipline, which covers a wide range of topics. The first known event of hacking had taken place in 1960 at MIT and at the same time, the term "Hacker" was originated. In this tutorial, we will take you through the various concepts of Ethical Hacking and explain how you can use them in a real-time environment.', 43, '06/26/2017 07:00'),
(18, 6, 'student', 'Firstly, people work to sharpen their skills as well as to learn many aspects of knowledge to solve the problems that helps them to overcome difficulties. Work gives us wisdom. Without working no one can improve his/her skills, knowledge and intelligence. Thus those who work hard enjoy a wonderful life.\r\n\r\nSecondly, people work to realize the value of living by producing large amount of goods and services. A farmer is not a farmer until he plant crops; a teacher is not a teacher until she teach classes. They all have their responsibilities and they also win our respects because of their contributions to the society. Thatâ€™s the meaning of life, which gives us courage and confidence to exert our powers to build a happy home.', 70, '07/05/2017 19:05');

